import React from 'react';
import './App.css';
import Bar from './bar';

function Visualizer() {

    return (
        <div className="visualizer-container">
            <div className="array-container">
                <Bar width="50px" height="500px"/>
            </div>
      </div>
    );
  }
  
  export default Visualizer;
